import { Form, FormGroup, Input, Navbar, NavbarBrand, NavItem, Nav, Collapse, NavLink, UncontrolledDropdown, DropdownToggle, DropdownItem, DropdownMenu, NavbarToggler } from 'reactstrap';
import React from 'react';

class NavBar extends React.Component{
    constructor(props) {
        super(props);
    
        this.toggle = this.toggle.bind(this);
        this.state = {
          isOpen: false
        };
    }
    toggle() {
    this.setState({
        isOpen: !this.state.isOpen
    });
    }
    render(){
        return(
        // <div>
        // <Navbar color="light" light expand="md">
        //     <NavbarBrand href="/">Image Search</NavbarBrand>
        //     <Nav classname="ms-auto" navbar>
        //         <NavItem>abcd</NavItem>
        //         {/* <Form classname="">
        //             <FormGroup>
        //                 <Input type="text" placeholder="Search Images ..."></Input>
        //             </FormGroup>
        //         </Form> */}
        //     </Nav>
        // </Navbar>
        // </div>
        <div>
        <Navbar color="light" light expand="md">
          <NavbarBrand href="/">reactstrap</NavbarBrand>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <NavItem>
                <NavLink href="/components/">Components</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="https://github.com/reactstrap/reactstrap">GitHub</NavLink>
              </NavItem>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  Options
                </DropdownToggle>
                <DropdownMenu right>
                  <DropdownItem>
                    Option 1
                  </DropdownItem>
                  <DropdownItem>
                    Option 2
                  </DropdownItem>
                  <DropdownItem divider />
                  <DropdownItem>
                    Reset
                  </DropdownItem>
                </DropdownMenu>
              </UncontrolledDropdown>
            </Nav>
          </Collapse>
        </Navbar>
      </div>
        );
    }
}

export default NavBar
